		function clickF(event) { //פונקציה שבודקת את ההתאמה ומיצרת תנועה של הטיקר
			directionX = parseInt((event.currentTarget.x - ball.x) / 25) ////חישוב מהירות התקדמות על ציר הרוחב
			directionY = parseInt((event.currentTarget.y - ball.y) / 25) ///חישוב מהירות התקדמות על ציר הגובה
			hit = (event.currentTarget.name.substr(4, 4)) //"גזירת" הקטגוריה מהשם של הבועה שנבחרה ע"י קליק
			console.log(hit)
			hitY = (event.currentTarget.y)
			hitX = (event.currentTarget.x)
			pressb = (event.currentTarget.name) //שמירת שם הבועה שנלחצה במשתנה לשם נוחיות השימוש בקוד
			removeLis(); //קריאה לפונקציה להסרת מאזינים מהבועות עד סיום בדיקת התאמה ויצירת בועה חדשה במקל הבועות
			for (i = 0; i < bub.length; i++) { //לולאה לאיתור הבועה במערך ועדכון סטטוס לנבחרה-כך שניתן יהיה לבדוק כמה פעמים בוצעה התאמה לבועה זו
				if (event.currentTarget.name.substr(0, 4) == bub[i][6]) {
					bub[i][5]++
				}
				//console.log(bub)
			}
			stick[rndB][4]++ //עדכון סטטוס ניסיון להתאמה לבועה מהמקל
			createjs.Ticker.paused = false //הפעלת הטיקר
			check = 1 //שינוי ערך משתנה שיסמן לטיימר לעצור
			var clicktime = 30 - timeleft
			if (clicktime == 30) {
				totalTime++
			} else {
				totalTime = totalTime + clicktime
			}
			if (totalTime > 60) {
				min++;
				totalTime = totalTime - 60
			}
		}
		
		//הפונקציה הזו פועלת כאשר המאזין של הטיקר קולט שינוי באחד מהמשתנים ששומרים על כיוון התקדמות
		function smoothMove() {
			if (createjs.Ticker.paused == false) //בדיקה של מצב הטיקר
			{
				ball.x += directionX;
				ball.y += directionY;
				if (hit == (stick[rndB][1])) { //במקרה שיש התאמה בקטגוריה של הבועות
					sucsses(); //משוב להצלחה
		
					if (intersect(Game.getChildByName(pressb), ball)) {
						directionX = 0;
						directionY = 0;
						createjs.Ticker.paused = true
						sucssesb();
						setTimeout(function () { //עצירת הקוד בזמן המפגש בין הבועות ע"מ לאפשר ניגון אנימצית משוב להצלחה
							Game.removeChild(Game.getChildByName(pressb)); //בתום האנימציה הסרת זוג הבועות מהבמה
							Game.removeChild(Game.getChildByName(stick[rndB][1]));
							match[match.length] = stick[rndB] //העתקת שורת הבועה שנורתה ממערך המקל למערך חדש
						//	match.push.apply(stick[rndB])
							stick.splice(rndB, 1) //מחיקת ערך הבועה ש"נורתה" מהמאגר
							for (i = 0; i < 14; i++) { //לולאה לעדכון מערך השמות המשמש להסרת מאזינים בזמן הפעלת מסכי השהייה
								if (names[i] == pressb) {
									names.splice(i, 1) //גזירת שם הבועה שהוסרה מהבמה ממערך השמות
								}
							}
							GetRndB();
							createball();
							restoreLis();
						}, 1500);
						console.log("match=" +match)
					}
				} else { //במידה ובוצעה התאמה שגויה - כלומר הבועות אינן שייכות לאותה קטגוריה
					Wrong(); //משוב לאי הצלחה על הבועה שיצאה ממקל הבועות מופיע מיידית
					if (intersect(Game.getChildByName(pressb), ball) && wrongHit == false) {
						wrongHit = true //משתנה שמסייע לעצירת הטיקר באופן חד פעמי בעת מפגש הבועות
						createjs.Ticker.paused = true;
						setTimeout(function () { //עצירת הטיקר בעת המפגש כדי לאפשר רפלקציה ללומד
							createjs.Ticker.paused = false;
						}, 500);
						Wrongb(); //משוב לאי הצלחה על הבועה הנבחרת מופיע עם הגעת הכדור למפגש עם הבועה
					}
					var myball = Game.getChildByName(stick[rndB][1]);
					if (myball.y < 0 || myball.x < 0 || myball.x > canvW) { //בדיקה שהבועה שהופרחה ממקל הבועות יוצאת את גבולות הבמה
						directionX = 0;
						directionY = 0;
						createjs.Ticker.paused = true;
						Game.removeChild(myball); //הסרת בועה שלא הותאמה נכון מהבמה - הבועה תוגרל שוב בהמשך עד שתתותאם נכון ע"י הלומד
						Game.getChildByName(pressb).removeChild(Game.getChildByName(pressb).getChildByName("mistake")); //הסרת משוב אי הצלחה לקראת סיבוב נוסף
						misNo++;
						if (rndB != 0) { //בדיקה שהגרלת הכדור הבא לא תחזור לאותו כדור
							rndB = rndB - 1
						} else {
							GetRndB()
						}
						createball();
						restoreLis();
						wrongHit = false;
					}
				}
			}
		}
		
